<script>
    var datos = JSON.parse('<?php echo json_encode($datos); ?>');
    var cuadroQualification;
    var rank = 1;

    for (var i = 0; i < datos.length; i++) {        
        var area = datos[i].area.normalize('NFD').replace(/[\u0300-\u036f]/g, "");
        var qualification = datos[i].qualification;

        var element = document.getElementById(area);
        if(area == "Oficinas Divisional  "){
            element.style.fill = 'white';
            continue;
        }
        if (element) {
            if (qualification >=90) {
                element.style.fill = 'green';
            } else if (qualification >= 75 && qualification <= 90) {
                element.style.fill = 'yellow';
            } else {
                element.style.fill = 'red'; 
            }
            element.style.stroke = 'black';
            element.style.strokeWidth = '8';
                
            element.setAttribute('data-qualification', qualification);
            
            element.addEventListener('mouseenter', createMouseEnterCallback(rank));
                            
            element.addEventListener('mouseleave', function() {
                if (cuadroQualification) {
                    document.body.removeChild(cuadroQualification);
                    cuadroQualification = null;
                }
            });
                hoverText(area, qualification,rank);
                
                rank++;
        }       
    }

    function createMouseEnterCallback(rank) {
        return function(event) {
            var qualification = parseFloat(this.getAttribute('data-qualification'));
            cuadroQualification = document.createElement('span');
            cuadroQualification.innerText ='Ranking: ' + rank + ' Calificacin: ' + qualification.toFixed(2);
            cuadroQualification.style.position = 'absolute';
            cuadroQualification.style.background = '#f8f8f8';
            cuadroQualification.style.border = '4px solid #000';
            cuadroQualification.style.boxShadow = '2px 2px 5px rgba(0, 0, 0, 0.2)';
            cuadroQualification.style.padding = '10px';
            cuadroQualification.style.top = (event.pageY + 20) + 'px';
            cuadroQualification.style.left = event.pageX + 'px';
            cuadroQualification.style.fontWeight = '800';
            cuadroQualification.style.fontSize = '20px';
            document.body.appendChild(cuadroQualification);
        }
    }

    function hoverText(area, qualification, rank)
    {
        var area;
        if (area == "Zona Metropolitana Hidalgo") {
            area = "Hidalgo";
        } else if (area == "Zona Metropolitana Juarez") {
            area = "Juarez";
        } else if (area == "Zona Metropolitana Reforma") {
            area = "Reforma";
        } else if (area == "Zona Metropolitana Libertad") {
            area = "Libertad";
        } else {
            return; // no hacer nada si no se cumple ninguna condicin
        }

        var element = document.getElementById(area);
        element.setAttribute('data-qualification', qualification);

        element.addEventListener('mouseenter', function(event) {
                var qualification = parseFloat(this.getAttribute('data-qualification'));
                cuadroQualification = document.createElement('span');
                cuadroQualification.innerText ='Ranking: ' + rank + ' Calificacin: ' + qualification.toFixed(2);
                cuadroQualification.style.position = 'absolute';
                cuadroQualification.style.background = '#f8f8f8';
                cuadroQualification.style.border = '4px solid #000';
                cuadroQualification.style.boxShadow = '2px 2px 5px rgba(0, 0, 0, 0.2)';
                cuadroQualification.style.padding = '10px';
                cuadroQualification.style.top = (event.pageY + 20) + 'px';
                cuadroQualification.style.left = event.pageX + 'px';
                cuadroQualification.style.fontWeight = '800';
                cuadroQualification.style.fontSize = '20px';
                document.body.appendChild(cuadroQualification);
            });
                        
            element.addEventListener('mouseleave', function() {
                if (cuadroQualification) {
                    document.body.removeChild(cuadroQualification);
                    cuadroQualification = null;
                }
            });
    }
</script>
